            </TitleContainer>
            <CardContainer>
                <PortfolioCard title="Risk"/>
                <PortfolioCard title="Tic Tac Toe"/>
                <PortfolioCard title="Calculator"/>
                <PortfolioCard title="Information Retrieval"/>
            </CardContainer>
        </ContentWrapper>

            {/* <CardTitle>Software application</CardTitle>
            <CardContainer>
                <PortfolioCard title="Password Generator"/>
                <PortfolioCard title="Simon Says"/>
            </CardContainer> */}


        </Wrapper>
    )
}

export {Portfolio}

